//form.jsx

import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import StudentForm from './ContactUs';
import jsonData from '../db.json';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.css';

function handleDelete() {

}

function TableData() {
    const [Data, setData] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:3000/contacts')
            .then(res => setData(res.data))
            .catch(err => console.log(err))
    }, [])
    return (
        <div className='container d-flex flex-column justify-content-center align-items-center bg-light '>
            <h1>List of Contacts</h1>
            <div className='d-flex justify-content-end'>
                <Link to="/addcontact" className="btn btn-success">Add</Link>
            </div>
            <table className="table">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">ID</th>
                        <th scope="col">NAME</th>
                        <th scope="col">CONTACT</th>
                        <th scope="col">View</th>
                        <th scope="col">Edit</th>
                        <th scope="col">Delete</th>

                    </tr>
                </thead>
                <tbody>
                    {
                        Data.map((d, i) => (
                            <tr>
                                <th scope="row">{i+1}</th>
                                <td>{d.id}</td>
                                <td>{d.name}</td>
                                <td>{d.contact}</td>
                                <td>View</td>
                                <td><Link to={`/updatecontact/${d.id}`}>Update</Link></td>
                                <td><button onClick={e => handleDelete(d.id)} className='btn btn-primary'>Delete</button></td>
                            </tr>

                        ))
                    }

                </tbody>
            </table>

        </div>
    )

}

export default TableData;
